import Head from 'next/head'

const Home = () => (
  <div className="container">
    <Head>
      <title>Kemble Song</title>
      <meta name="theme-color" content="#ffffff" />
      <meta name="description" content="Kemble Song is a software engineer and creative currently based in Melbourne, Australia" />
    </Head>

    <main>
      <h1>Kemble is a <span className="highlight">software engineer</span> and <span className="highlight-lighter">creative</span> currently based in <span className="highlight-alt">Melbourne</span>.</h1>
      <ul class="floating__body menu">
        <li><a class="menu__item" href="//www.linkedin.com/in/kemblesong">linkedin</a></li>
        <li><a class="menu__item" href="//github.com/kemblesong">github</a></li>
        <li><a class="menu__item" href="//instagram.com/kemblog">instagram</a></li>
        <li><a class="menu__item" href="mailto:yo@ksong.co">email me</a></li>
      </ul>
    </main>

    <footer></footer>

    <style jsx>{`
      .container {
        min-height: 100vh;
        padding: 0 0.5rem;
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
      }
      main {
        padding: 5rem 0;
        flex: 1;
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
      }
      footer {
        width: 100%;
        height: 100px;
        border-top: 1px solid #eaeaea;
        padding-top: 1rem;
      }
      .footerContainer {
        display: flex;
        justify-content: center;
        align-items: center;
      }
      footer img {
        margin-left: 0.5rem;
      }
      footer a {
        color: #0070f3;
        display: flex;
        justify-content: center;
        align-items: center;
      }
      a {
        color: inherit;
        text-decoration: none;
      }
      a:hover {
        text-decoration: underline;
      }
      .title a {
        color: #0070f3;
        text-decoration: none;
      }
      .title a:hover,
      .title a:focus,
      .title a:active {
        text-decoration: underline;
      }
      .title {
        margin: 0;
        margin-bottom: 1.5rem;
        line-height: 1.15;
        font-size: 8rem;
        font-weight: 400;
        font-style: normal;
      }
      .title,
      .description,
      .lede {
        text-align: center;
      }
      .lede {
        font-size: 1.25rem;
        font-weight: bold;
      }
      .description {
        line-height: 1.5;
        font-size: 1.25rem;
      }
      .description a:hover,
      .description a:focus,
      .description a:active {
        text-decoration: underline;
      }
      .description a {
        color: #0070f3;
        text-decoration: none;
      }
      code {
        background: #fafafa;
        border-radius: 5px;
        padding: 0.75rem;
        font-size: 1.1rem;
        font-family: Menlo, Monaco, Lucida Console, Liberation Mono,
          DejaVu Sans Mono, Bitstream Vera Sans Mono, Courier New, monospace;
      }
      .grid {
        display: flex;
        align-items: center;
        justify-content: center;
        flex-wrap: wrap;
        max-width: 1400px;
        margin-top: 3rem;
        margin-right: -3rem;
      }
      .grid > * {
        margin-right: 3rem;
        margin-bottom: 3rem;
      }
      .card {
        margin: 1rem;
        flex-basis: 45%;
        padding: 1.5rem;
        text-align: left;
        color: inherit;
        text-decoration: none;
        border: 1px solid #eaeaea;
        border-radius: 10px;
        transition: color 0.15s ease, border-color 0.15s ease;
      }
      .card:hover,
      .card:focus,
      .card:active {
        color: #0070f3;
        border-color: #0070f3;
      }
      .card h3 {
        margin: 0 0 1rem 0;
        font-size: 1.5rem;
      }
      .card p {
        margin: 0;
        font-size: 1.25rem;
        line-height: 1.5;
      }
      @media (max-width: 600px) {
        .grid {
          width: 100%;
          flex-direction: column;
          margin-right: 0;
        }
        .grid > * {
          margin-right: 0;
        }
        .title {
          font-size: 5rem;
          margin-bottom: 1rem;
        }
        .description {
          padding: 0 0.5rem;
          font-size: 1.25rem;
        }
        footer {
          font-size: 0.75rem;
        }
        .footerContainer {
          display: block;
          text-align: center;
        }
        .hideMobile {
          display: none;
        }
      }
    `}</style>

    <style jsx global>{`
      html,
      body {
        padding: 0;
        margin: 0;
        background-color: #fafafa;
        font-family:  -apple-system, BlinkMacSystemFont, Segoe UI, Roboto, Oxygen,
          Ubuntu, Cantarell, Fira Sans, Droid Sans, Helvetica Neue, sans-serif;
      }
      * {
        box-sizing: border-box;
      }
    `}</style>
  </div>
)

export default Home
